function Unidade({ units, isLoading }) {
  return isLoading ? (
    <h1>Loading</h1>
  ) : (
    <div>
      {
          units.map(unit=>(
              <div key={unit.id} item={unit}></div>
          ))
      }
    </div>
  );
}

export default Unidade;
